import React from "react";

const Profile=()=>{
    const userString = localStorage.getItem("user"); 
    const userObject = JSON.parse(userString); 
    const name = userObject.name;
    const email = userObject.email;
    const apartment_no = userObject.apartment_no;
    const phone_no = userObject.phone_no;
    const password=userObject.password;

    return(
        <div class="container">
        <div class="profile">
            <h1 class="profile-title">Profile</h1>
                <div class="form-group">
                    <label for="name">Name:</label>
                    <input type="text" id="name" name="name" required/>
                </div>
                <div class="form-group">
                    <label for="email">Email:</label>
                    <input type="email" id="email" name="email" required/>
                </div>
                <div class="form-group">
                    <label for="phone">Phone:</label>
                    <input type="tel" id="phone-no" name="phone-no" required/>
                </div>
                <div class="form-group">
                    <label for="house-no">House Number:</label>
                    <input type="text" id="house-no" name="house-no" required/>
                </div>
                <div class="form-group">
                    <label for="password">Password:</label>
                    <input type="password" id="password" name="password" required/>
                </div>
                
        </div>
    </div>
    )
}

export default Profile;
